import React from "react";
import devProfile from "../../resources/images/me and the mountain call.JPG";
const About = () => {
  return (
    <div className="container">
      <div className="row">
        <div
          className="col-6 border border-5 my-5 justify-content-center text-center"
          style={{ borderColor: "black !important", height: "60vh" }}
        >
          <img
            src={devProfile}
            alt=""
            className="rounded-circle"
            style={{ height: "50vh", width: "50vh" }}
          />
        </div>
        <div className="col-6">TEXT</div>
      </div>
    </div>
  );
};

export default About;
